import axios from 'axios'
import React, { useState, useEffect } from 'react'
import AllCigars from '../components/AllCigars'
import CigarForm from '../components/CigarForm'
import NavBar from '../components/NavBar'


const Main = () => {

    const [cigarList, setCigarList] = useState([])

    useEffect(() => {
        const getCigars = async () => {
            try {
                const res = await axios.get(`http://localhost:8000/api/cigars`)
                console.log(res)
                console.log(res.data)
                setCigarList(res.data)
            } catch (error) {
                console.log(error)
            }
        }
        getCigars()
    }, [])

    return (
        <div>

            <NavBar />

            <CigarForm 
            cigarList={cigarList} 
            setCigarList={setCigarList} />

            <AllCigars 
            cigarList={cigarList} 
            setCigarList={setCigarList}
            />

        </div>
    )
}

export default Main
